import gql from "graphql-tag"

const GET_INVESTOR_BY_ID = gql`
  query investor ($id: String!) {
    investor (id: $id) {
      id
      name
      description
      description
      slug
      cover
      phone
      mobile
      email
      website
      image
      created_at
      updated_at
    }
  }
`;

export {
  GET_INVESTOR_BY_ID,
}
